import { Button, FormLabel, Input, InputLabel } from '@material-ui/core';
import React, { useState } from 'react'

const Register = () => {
    const [formData, setFormdata] = useState({
        username: "",
        password: "",
        passwordCopy: ""
    })
    const [submitting, setSubmitting] = useState(false);

    const handleSubmit = event => {
        event.preventDefault();
        setSubmitting(true);

        console.log(formData)

        setTimeout(() => {
            setSubmitting(false);
        }, 3000);
    }

    const handleChange = (event: { target: { name: any; value: any; }; }) => {
        const value = event.target.value
        setFormdata({
            ...formData,
            [event.target.name]: value
        })

    }

    return (
        <>
            <div className="registerWrapper">
                <h1 className="form-header">Register Page</h1>
                <h1 className="form-header2">Register Page</h1>

                {submitting &&
                    <h1>Submitting...</h1>}
                <form className="register-form" onSubmit={handleSubmit}>
                    <FormLabel>Create a user</FormLabel>
                    <InputLabel>Username</InputLabel>
                    <Input id="username" name="username" type="text" value={formData.username} onChange={handleChange} ></Input>
                    <InputLabel>Password</InputLabel>
                    <Input id="password" name="password" type="password" value={formData.password} onChange={handleChange} ></Input>
                    <InputLabel>Re-enter password</InputLabel>
                    <Input id="repassword" name="passwordCopy" type="password" value={formData.passwordCopy} onChange={handleChange} ></Input>
                    <Button >Submit form</Button>
                </form>
            </div>
        </>
    )
}

export default Register
